class MoreInfo {
  MoreInfo({
      dynamic paymentOnDelivery, 
      dynamic freeShipping, 
      dynamic sameDayDelivery, 
      List<String>? shippingTypes, 
      dynamic heavyItems, 
      dynamic sameDayFreeShipping,}){
    _paymentOnDelivery = paymentOnDelivery;
    _freeShipping = freeShipping;
    _sameDayDelivery = sameDayDelivery;
    _shippingTypes = shippingTypes;
    _heavyItems = heavyItems;
    _sameDayFreeShipping = sameDayFreeShipping;
}

  MoreInfo.fromJson(dynamic json) {
    _paymentOnDelivery = json['payment_on_delivery'];
    _freeShipping = json['free_shipping'];
    _sameDayDelivery = json['same_day_delivery'];
    _shippingTypes = json['shipping_types'] != null ? json['shipping_types'].cast<String>() : [];
    _heavyItems = json['heavy_items'];
    _sameDayFreeShipping = json['same_day_free_shipping'];
  }
  dynamic _paymentOnDelivery;
  dynamic _freeShipping;
  dynamic _sameDayDelivery;
  List<String>? _shippingTypes;
  dynamic _heavyItems;
  dynamic _sameDayFreeShipping;
MoreInfo copyWith({  dynamic paymentOnDelivery,
  dynamic freeShipping,
  dynamic sameDayDelivery,
  List<String>? shippingTypes,
  dynamic heavyItems,
  dynamic sameDayFreeShipping,
}) => MoreInfo(  paymentOnDelivery: paymentOnDelivery ?? _paymentOnDelivery,
  freeShipping: freeShipping ?? _freeShipping,
  sameDayDelivery: sameDayDelivery ?? _sameDayDelivery,
  shippingTypes: shippingTypes ?? _shippingTypes,
  heavyItems: heavyItems ?? _heavyItems,
  sameDayFreeShipping: sameDayFreeShipping ?? _sameDayFreeShipping,
);
  dynamic get paymentOnDelivery => _paymentOnDelivery;
  dynamic get freeShipping => _freeShipping;
  dynamic get sameDayDelivery => _sameDayDelivery;
  List<String>? get shippingTypes => _shippingTypes;
  dynamic get heavyItems => _heavyItems;
  dynamic get sameDayFreeShipping => _sameDayFreeShipping;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['payment_on_delivery'] = _paymentOnDelivery;
    map['free_shipping'] = _freeShipping;
    map['same_day_delivery'] = _sameDayDelivery;
    map['shipping_types'] = _shippingTypes;
    map['heavy_items'] = _heavyItems;
    map['same_day_free_shipping'] = _sameDayFreeShipping;
    return map;
  }

}